                <h1 className="logo-text">Website Name</h1>
            </div>
            <div className="navbar-hamburger">
                <div className="hamburger-button">
                    <Hamburger color="black" />
                </div>
                {/* <div className={classes}>
                    <ul className="hamburger-links">
                        <div>About</div>
                        <div>Experience</div>
                        <div>Projects</div>
                    </ul>
                </div> */}
            </div>
        </div>
    );
};

export default Navbar;
